import React, { Component } from 'react';
import './App.css';
import {Map, InfoWindow, Marker, GoogleApiWrapper} from 'google-maps-react';



const style = {
  width: '100%',
  height: '80%'
}
class App extends Component {

  render() {
    return (
      <div className="App">
        <header className="App-header">
        <h1 className="App-title">Ciudad de MÃ©xico</h1>
        </header>

      <Map google={this.props.google}
       zoom={13}
       style={style}
          initialCenter={{
            lat:19.419444,lng:-99.145556
          }}
          onClick={this.onMapClicked}>

 <Marker position={{lat:19.433857,lng:-99.097779},{lat:19.34556,lng:-99.98787}} onClick={this.onMarkerClick}
         name={'Mexico'} />

 <InfoWindow onClose={this.onInfoWindowClose}>

 </InfoWindow>
</Map>

      </div>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: ("AIzaSyCVH8e45o3d-5qmykzdhGKd1-3xYua5D2A")
})(App)
